import React from 'react'

const Numbers = (props) => {
  return (
    <div className="flex  flex-row items-center gap-3">
      <div className="text-white font-semibold text-4xl">{props.num}</div>
      <div className="text font-medium text-xl">{props.line}</div>
    </div>
  );
}

export default Numbers
